const MostrarDatos = ({canales}) => {
    console.log(canales)
    const channel = canales.map((canal, index) => {
        return <li key={index}>{canal.nombre}</li>

    });
    return ( 
        <>

        <ul>{channel}</ul>

        </>           
     );
}

export default MostrarDatos;
